import React from "react";

const Profile = ({ data }) => {
  if (!data) {
    return <div>Loading profile...</div>;
  }

  return (
    <div className="profile">
      <h2>{data.name}</h2>
      <img
        src={data.profile_pic || "default-image-url"}  // Replace with actual default image
        alt={`${data.name}'s profile`}
      />
      <p><strong>Degree:</strong> {data.degree}</p>
      <p><strong>Experience:</strong> {data.experience} years</p>
      <p><strong>Expertise:</strong> {data.top_expertise}</p>
      <p><strong>Phone:</strong> {data.phone_number}</p>
      <p><strong>Address:</strong> {data.address}</p>
      <p><strong>Hospital:</strong> {data.hospital}</p>
      <p><strong>Fees:</strong> ${data.fees}</p>
      <p><strong>Available Days:</strong> {data.available_days}</p>
      <p><strong>Timings:</strong> {data.available_timings}</p>

      <h3>Services Offered:</h3>
      {data.services.length > 0 ? (
        <ul>
          {data.services.map((service) => (
            <li key={service.id}>{service.service_name}</li>
          ))}
        </ul>
      ) : (
        <p>No services available.</p>
      )}
    </div>
  );
};

export default Profile;
